import React from "react";
import "./App.css";
import { Switch, Route, Redirect } from "react-router-dom";
import CustomerList from "./containers/CustomerList";

function App() {
  return (
    <Switch>
      <Route path={"/"} exact component={CustomerList} />
      <Route path={"/user/:id"} exact component={null} />
      <Redirect path={"/"} />
    </Switch>
  );
}

export default App;
